glm::vec3 Checkerboard::getColour(glm::vec3 point) {
	bool x = (int)((point.x + POINT_OFFSET) / scale) % 2 == 0;
	bool y = (int)((point.y + POINT_OFFSET) / scale) % 2 == 0;
	bool z = (int)((point.z + POINT_OFFSET) / scale) % 2 == 0;

	if (x ^ y ^ z) {
		return colour1;
	}
	else {
		return colour2;
	}
}

